import React from 'react';
// import { ArrowUpIcon } from '../../../../../assets/images/Icons.jsx';
import PropTypes from 'prop-types';

const LatestLaunchesComponent = ({ trend }) => {
    return (
        <div className="latestLaunches">
          <div className="header">
            <div className="title">Trending launches</div>
          </div>
          <div className="trends">
            {trend.map((item) => (
              <div>
                <img src={item.image} />
                <h3>{item.title}</h3>
                <div className="tagline">{item.tagline}</div>
                <div className="actions">
                <svg width="1280.000000pt" height="640.000000pt" viewBox="0 0 1280.000000 640.000000">
    <g transform="translate(0.000000,640.000000) scale(0.100000,-0.100000)" fill={props.fill} stroke="none">
    <path d="M3198 3205 c-1759 -1756 -3198 -3196 -3198 -3199 0 -3 2880 -6 6400 -6 3520 0 6400 3 6400 7 0 7 -6388 6387 -6399 6390 -3 1 -1445 -1435 -3203 -3192z"/>
    </g>
  </svg>
                  {/* <img src={upIcon} width="10px" height="10px" className="arrow" /> */}
                  {item.votesCount} 
                  <span>&#8226;</span> 
                  {item.comments.length} Comments
                </div>
              </div>
            ))}
          </div>
        </div>
    )
}

export default LatestLaunchesComponent;
